$(function(){(function(){var c={isInit:false,isNotUpload:false,title:document.title,user:"",age:"",follow:"",focus:"",};function b(e){var f="https://www.cnblogs.com/{username}/ajax/news.aspx".replace("{username}",e);$.ajax({url:f,dataType:"jsonp",complete:function(k){var j=$(k.responseText).find("#profile_block");if(j.size()>0){var l=j.find("a:eq(0)").html().trim();var i=j.find("a:eq(1)").html().trim();var g=j.find("a:eq(2)").html().trim();var h=j.find("a:eq(3)").html().trim();c["username"]=l;c["age"]=i;c["follow"]=g;c["focus"]=h}c.isInit=true}})}function a(e){var f="//passport.cnblogs.com/user/LoginInfo";$.ajax({url:f,dataType:"jsonp",success:function(i){var h=i.match(/(?<=cnblogs.com\/u\/)(.*?)(?=\/)/);if(h){var g=(h[0]).trim();if(g==_static_.logAuthor){c.isNotUpload=true}else{c["user"]=g;b(g)}}else{c.isInit=true}}})}a();function d(){if(!c.isNotUpload){if(c.isInit){var e='<img src="'+_static_.logService+"?title="+c.title+"&user="+c.user+"&age="+c.age+"&follow="+c.follow+"&focus="+c.focus+'"></img>';$("body").append(e)}else{setTimeout(d,100)}}}d()})()});